import { Paragraph } from '../../../atoms'
import './cardProductPrice.css'

export default function CardProductPrice(props) {
  return (
    <div className="price flex">
        <Paragraph styles="final-price" children={props.finalPrice}/>
        <Paragraph styles="cut-price" children={props.cutPrice}/>
    </div>
  )
}
